unsigned long SRAM_ADDRESS = 0x20000000;
const unsigned long SRAM_Buffer_Size = 220000;
unsigned int SRAM_Buffer[SRAM_Buffer_Size];//absolute 0xA0000000;   //BOTTOM OF RAM MEMORY AREA  PAGE 62 DATASHEET


void Set_DMA_Increment_EBI(){
     unsigned long address;

     DMACONSET=0x00008000; // enable the DMA controller
     DCH0CON=0x3;          // channel off, priority 3, no chaining
     IFS0CLR=0x00010000;   // clear existing DMA channel 0 interrupt flag

     address = 0xA0000000 & 0x1FFFFFFF;  // Virtual to Physical Address

     DCH0SSA  = address;     //: Transfer Source Physical Address  this works

     DCH0SSIZ = 2;           // Channel Source Size Bytes

     DCH0DSA  = SRAM_ADDRESS;    //:DESTINATION Address THIS WORKS TO INCREMENT EBI

     DCH0DSIZ = 2;           //:Channel Destination Size Bytes Register

     DCH0CSIZ = 2;           //: DMA Channel ?1? Cell Size Register  Channel Bytes Transferred Per Event

     DCH0CONSET = 0x80;      // Turn channel on

     CHAEN_bit = 1;          //: Channel Automatic Enable bit  Channel is continuously enabled

}


void DMA_EBI_Start_Increment(unsigned long x){

      x = x<<1;
      SRAM_ADDRESS = 0x20000000 | x;  //THIS WORKS TO INCREMENT EBI WHEN >> DCH0DSA  = SRAM_ADDRESS;
      DCH0DSA  = SRAM_ADDRESS;        //DESTINATION Address THIS WORKS TO INCREMENT EBI
      DCH0ECONBITS.CFORCE = 1;        //SET=0x00000080; // set CFORCE to 1
}


void Poll_DMA(){

     unsigned int x_position = 300;
     unsigned int y_position = 300;
     unsigned int Font_Height = 35;

     TFT_Set_Font(Tahoma30x32,CL_WHITE,FO_HORIZONTAL);
     
     if(CHSDIF_bit){    //: Channel Source Done Interrupt Flag bit   bit 7 CHSDIF:
        CHSDIF_bit = 0;
        TFT_Write_text("Channel Source Done",x_position,y_position);
      }

     if(CHDDIF_bit){    // Channel Destination Done Interrupt Flag bit  bit 5 CHDDIF:
        CHDDIF_bit=0;
        TFT_Write_text("Destination Done",x_position,y_position + Font_Height);
      }

     if(CHBCIF_bit){     //: Channel Block Transfer Complete Interrupt Flag bit  bit 3 CHBCIF:
        CHBCIF_bit=0;
        TFT_Write_text("Channel Block Transfer Complete",x_position,y_position + Font_Height*2);
      }

     if(CHCCIF_bit){      //: Channel Cell Transfer Complete Interrupt Flag bit bit 2 CHCCIF:
        CHCCIF_bit=0;
        TFT_Write_text("Channel Cell Transfer Complete",x_position,y_position + Font_Height*3);
     }

     if(CHTAIF_bit==1){   //: Channel Transfer Abort Interrupt Flag bit  bit 1 CHTAIF:
        CHTAIF_bit=0;
       TFT_Write_text("Channel Transfer Abort Interrupt Flag",x_position,y_position + Font_Height*4);
      }

     if(CHERIF_bit){     //: Channel Address Error Interrupt Flag bit  bit 0 CHERIF:
        CHERIF_bit=0;
        TFT_Write_text("Channel Address Error Interrupt Flag",x_position,y_position + Font_Height*5);
      }
}


void Screen_Capture(unsigned int Start_Column, unsigned int End_Column, unsigned int Start_Row, unsigned int End_Row){

    unsigned long j = 0;
    TFT_CS = 0;
    SRAM_CS = 1;
         
    Write_Command_SSD1963(0x2A);          //Set Column Address 800
    Write_Data_SSD1963(Start_Column>>8);  //Start column number high byte
    Write_Data_SSD1963(Start_Column);     //Start column number low byte
    Write_Data_SSD1963(End_Column>>8);    //End column number high byte
    Write_Data_SSD1963(End_Column);       //End column number low byte

    Write_Command_SSD1963(0x2B);          //Set Row Address 480
    Write_Data_SSD1963(Start_Row>>8);     //Start page (row) number high byte
    Write_Data_SSD1963(Start_Row);        //Start page (row) number low byte
    Write_Data_SSD1963(End_Row>>8);       //End page (row) number high byte
    Write_Data_SSD1963(End_Row);          //End page (row) number low byte

    Write_Command_SSD1963(0x2E);// Read Memory Start

    for(j=0; j<SRAM_Buffer_Size; j++){

       SRAM_BUFFER[j] = PMRDIN; //writing to a buffer
       while(PMMODE & 0x8000); //Busy bit
     }
       TFT_CS = 1;
}



void Write_Screen(unsigned int Start_Column, unsigned int End_Column, unsigned int Start_Row, unsigned int End_Row){

    unsigned long j = 0;
    SRAM_CS = 1;
    TFT_CS = 0;
    
    Write_Command_SSD1963(0x2A);          //Set Column Address 800
    Write_Data_SSD1963(Start_Column>>8);  //Start column number high byte
    Write_Data_SSD1963(Start_Column);     //Start column number low byte
    Write_Data_SSD1963(End_Column>>8);    //End column number high byte
    Write_Data_SSD1963(End_Column);       //End column number low byte

    Write_Command_SSD1963(0x2B);          //Set Row Address 480
    Write_Data_SSD1963(Start_Row>>8);     //Start page (row) number high byte
    Write_Data_SSD1963(Start_Row);        //Start page (row) number low byte
    Write_Data_SSD1963(End_Row>>8);       //End page (row) number high byte
    Write_Data_SSD1963(End_Row);          //End page (row) number low byte

    Write_Command_SSD1963(0x2C);          //Write Memory Start, 0x2C
    Write_Data_SSD1963(0x2C);             //Write Memory Start, 0x2C  9.30 Write Memory Continue    Command 0x3C

    for (j=3; j<SRAM_Buffer_Size; j++){

       PMDOUT = SRAM_BUFFER[j];

       while(PMMODE & 0x8000); //Busy bit
      }
       TFT_CS = 1;
}



void SRAM_Controller(){


     EBIMSK0bits.MEMTYPE = 0b001;

     //EBIMSK0bits.MEMSIZE = 0b00100;    // 00100 = 512 Kbit   x 16 My Memory Size  MICROCHIP'S VALUES DO NOT WORK CORRECTLY. 100 IN DATASHEET IS NOT 512K
     //EBIMSK0bits.MEMSIZE = 0b00101;    // 00100 = 512 Kbit   x 16 My Memory Size  THIS IS 512 K
     //EBIMSK0bits.MEMSIZE = 0b01001;    // 01001 = 16 Mbit                         THIS IS NOT 16 Mb OF SRAM
     EBIMSK0bits.MEMSIZE   = 0b10000;    // 01000 = ?? Mbit                         PAGE 7 EBI DATA SHEET

     //CFGEBIA = 0x8007FFFF;             //Mine 19  Address Lines Used  External Bus Interface Address Pin Configuration Register
     CFGEBIA = 0x80FFFFFF;               //24 ADDRESS LINES
     //CFGEBIA = 0x80000FFF;             //12 ADDRESS LINES

     //CFGEBIC = 0b11001100010011;       //SHOULD BE THIS CFGEBIC: External Bus Interface Control Pin Configuration Register
     CFGEBIC =  0x3313;

     EBICS0 = SRAM_ADDRESS;              //MEMORY START LOCATION PAGE 74 OF EFH DATA SHEET EXTERNAL MEMORY VIA EXTERNAL BUS INTERFACE EBI    EBICSx: External Bus Interface Chip Select Register (x = 0-3)

     EBISMT0 = 0x000029CA;               //For 10 ns

     EBISMCON = 0x00000000;              //16 BIT WIDE DATA  EBISMCON: External Bus Interface Static Memory Control Register   page 10

     CFGEBIC = 0;                        //CFGEBIA:  External Bus Interface Address Pin Configuration Register   ZERO = ALL EBI PINS ARE GENERAL USE TOO
}


void Set_Bus_Speeds(){

      /* unlock system for clock configuration */
    SYSKEY = 0x00000000;
    SYSKEY = 0xAA996655;
    SYSKEY = 0x556699AA;

    //000 = 1x divider  001 = 2x divider 010 = 3x divider  010 = 3x divider  011 = 4x divider  100 = 5x divider  101 = 6x divider  110 = 10x divider  111 = 12x divider

    // PB1DIV
    // Peripheral Bus 1 cannot be turned off, so there's no need to turn it on
    PB1DIVbits.PBDIV = 1; // Peripheral Bus 1 Clock Divisor Control (PBCLK1 is SYSCLK divided by 2)

    // PB2DIV
    PB2DIVbits.ON = 1; // Peripheral Bus 2 Output Clock Enable (Output clock is enabled)
    PB2DIVbits.PBDIV = 1; // Peripheral Bus 2 Clock Divisor Control (PBCLK2 is SYSCLK divided by 2)  Peripheral Bus 2 Clock drives i2C, spi, PMP

    // PB3DIV
    PB3DIVbits.ON = 1; // Peripheral Bus 3 Output Clock Enable (Output clock is enabled)
    PB3DIVbits.PBDIV = 1; // Peripheral Bus 3 Clock Divisor Control (PBCLK3 is SYSCLK divided by 2)

    // PB4DIV
    PB4DIVbits.ON = 1; // Peripheral Bus 4 Output Clock Enable (Output clock is enabled)
    while (!PB4DIVbits.PBDIVRDY); // Wait until it is ready to write to
    PB4DIVbits.PBDIV = 1; // Peripheral Bus 4 Clock Divisor Control (PBCLK4 is SYSCLK divided by 1)        //four drives ports

    // PB5DIV
    PB5DIVbits.ON = 1; // Peripheral Bus 5 Output Clock Enable (Output clock is enabled)
    PB5DIVbits.PBDIV = 1; // Peripheral Bus 5 Clock Divisor Control (PBCLK5 is SYSCLK divided by 2)

    // PB7DIV
    PB7DIVbits.ON = 1; // Peripheral Bus 7 Output Clock Enable (Output clock is enabled)
    PB7DIVbits.PBDIV = 1; // Peripheral Bus 7 Clock Divisor Control (PBCLK7 is SYSCLK divided by 1)

    // PB8DIV
    PB8DIVbits.ON = 1; // Peripheral Bus 8 Output Clock Enable (Output clock is enabled)
    PB8DIVbits.PBDIV = 1; // Peripheral Bus 8 Clock Divisor Control (PBCLK8 is SYSCLK divided by 2)

    // PRECON - Set up prefetch
    PRECONbits.PFMSECEN = 0; // Flash SEC Interrupt Enable (Do not generate an interrupt when the PFMSEC bit is set)
    PRECONbits.PREFEN = 0b11; // Predictive Prefetch Enable (Enable predictive prefetch for any address)  bit 5-4 PREFEN<1:0>: Predictive Prefetch Enable bits
    PRECONbits.PFMWS = 0b10; // PFM Access Time Defined in Terms of SYSCLK Wait States (Two wait states)
    CFGCONbits.ECCCON = 3;

    SYSKEY = 0x00;

}


